import React from 'react';
import {Card, CardHeader, CardContent, Typography} from '@material-ui/core';

export default function Detail(){
    return(
        <div>
            <Card>
                <CardHeader title="income"/>
                <CardContent>
                    <Typography>
                        $50
                    </Typography>
                </CardContent>
            </Card>
        </div>
    )
}
